import { StyleSheet, Text, View } from 'react-native'
import React from 'react'
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import Home from '../screens/Home';
import Ads from '../components/Ads/Ads';
import Search from '../components/Search/Search';
import { Entypo } from '@expo/vector-icons';
import { Foundation } from '@expo/vector-icons';
import { Ionicons } from '@expo/vector-icons';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

const Stack = createNativeStackNavigator();

const Tab = createBottomTabNavigator();

const BottomTab = () => {
    return (
        <Tab.Navigator
            screenOptions={{
                headerShown: false,
                tabBarActiveTintColor: '#EC5668',
                tabBarShowLabel: false,
                tabBarInactiveTintColor: '#A4A4A4',
            }}
        >
            <Tab.Screen
                options={{ tabBarIcon: ({ focused }) => <Entypo name="home" size={24} color={focused ? '#EC5668' : '#A4A4A4'} /> }}
                name="Home"
                component={Home}
            />
            <Tab.Screen
                options={{ tabBarIcon: ({ focused }) => <Foundation name="shopping-cart" size={26} color={focused ? '#EC5668' : '#A4A4A4'} /> }}
                name="Cart"
                component={Ads}
            />
            <Tab.Screen
                options={{ tabBarIcon: ({ focused }) => <Ionicons name="settings" size={24} color={focused ? '#EC5668' : '#A4A4A4'} /> }}
                name="Profile"
                component={Search}
            />
        </Tab.Navigator>
    )
}

export default BottomTab

const s = StyleSheet.create({})
